#include <iostream>
#include <string>
#include <algorithm>

using namespace std;

class Solution {
public:
    int firstUniqChar(string s) {
        int count[26] = {0}; // 26 letters in the alphabet
        for (auto c : s) { // for each character in the string
            count[c - 'a']++; // increment the count of that character
        }
        for (int i = 0; i < s.size(); i++) { // for each character in the string
            if (count[s[i] - 'a'] == 1) { // if the count of that character is 1
                return i; // return the index of that character
            }
        }
        return -1; // if no unique characters are found, return -1
    }
};

int main()
{
    string s = "";
    Solution sol;
    int ans = sol.firstUniqChar(s);
    cout << ans << endl;
    return 0;
}